import React from 'react';
import Navigation from '../Navigation/Navigation';
import './MobileMenu.scss';

const MobileMenu = ({ navigation }) => {
  return (
    <div className="mobile-menu">
      <Navigation navigation={navigation} />
    </div>
  );
};

export default MobileMenu;
